import classNames from "classnames/bind";

import styles from "./Home.module.scss";

const cx  = classNames.bind(styles);
function Home() {
    return ( 
        <frameset cols="40%,60%">
            <frame src="http://webcoban.vn/file/ban-khai-nhan-khau.pdf"/>
            <frame src="../css/default.html"/>
        </frameset>
     );
}

export default Home;
